import React from "react";
import Carousel from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";
import './Carusel.css';
import Filmposter from './FilmPoster.js';

const Carusel = () => (
  <div
    className="Carusel"
 >
    <Carousel arrows >
        <Filmposter/>
    </Carousel>
  </div>
);

export default Carusel;
